import React from "react";
import { Link } from 'react-router-dom';

function FindInfo() {
  return (
    <div>
      <h1>회원정보 찾기 페이지입니다</h1>
      <Link to="/">회원가입</Link>
    </div>
    );
}

export default FindInfo;
